  justify-content: space-evenly;
  height: 25%;
  border-left: 60px solid black;
  border-right: 60px solid black;
  border-bottom: 60px solid #202020;
  border-top: 0px solid black;
  margin-top:-30px;
  margin-bottom: 10px;
  z-index: 1;
`
const Circle = styled.div`

  height: 50px;
  width: 50px;
  border-radius: 50%;
  background-color: grey;

`
const DivCircle = styled.div`
  width: 100%;
  position: absolute;
  bottom: 0px;
`

const App = () => {
  return (
    <AppContainer>
      <DivCassete>
        <DivStamp></DivStamp>
        <DivCasseteBottom>
          <Circle/>
          <Circle/>
          <Circle/>

        </DivCasseteBottom>
      </DivCassete>

    </AppContainer>
  );
}


export default App;
